      mw-headline\" id=\"Author.27s_Notes\">Author's Notes</span><span class=\"mw-editsection\"\
      ><span class=\"mw-editsection-bracket\">[</span><a href=\"/edit/DM-DE-Ironic?section=7\"\
      \ title=\"Edit section: Author's Notes\">edit</a><span class=\"mw-editsection-bracket\"\
      >]</span></span></h3>\n<blockquote style=\"margin-bottom: 0px;\">DM-DE-Ironic(UT2k3)\
      \ is a small Deathmatch level, mixing different meshes to create a new feel.\
      \ Most of the meshes used in the level were stock meshes that came with UT2003\
      \ but some new ones were made (the windows and plants). I wanted players of\
      \ this level to feel comfortable, that's why there is lots of sunlight and green\
      \ plants. Gameplay wise I wanted this level to be suitable for hardcore players.\
      \ There are lots of opportunities for trick jumping and the powerups are well\
      \ balanced. No super weapons or powerups were added outside of the big armor.\
      \ I am very glad this level was well received.<br /><br />I was responsible\
      \ for most of the layout / meshing / lighting and bug fixing.<sup id=\"cite_ref-1\"\
      \ class=\"reference\"><a href=\"#cite_note-1\">&#91;1&#93;</a></sup></blockquote><div\
      \ style=\"text-align: right; font-size: 88%; font-style: italic; margin-bottom:\
      \ 1em;\"><a href=\"/UT2003\" class=\"mw-redirect\" title=\"UT2003\">Checker's\
      \ Chapel</a></div>\n<h2><span class=\"mw-headline\" id=\"References\">References</span><span\
